// frontend/src/components/Footer/index.js
import React from 'react';
import { NavLink } from 'react-router-dom';
import { useSelector } from 'react-redux';

import './footer.css';

function Footer(){

    return(
      <>
          <div className="footer-container">
              <div className="footer-icons">
                  <a href="https://github.com/Twprcntmlk" className="github_logo">
                      <img src={'./'} alt="logo"/>
                  </a>//"../images/github-logo.png"
                  <a href="https://www.linkedin.com/in/stephen-choung-275b05172/" className="github_logo">
                      <img src={"/images/Linkedin-Icon.png"} alt="logo"/>
                  </a>
              </div>
              <h2>Built By: Stephen Choung</h2>
              <div className="footer-description">
                  <p> This AirBnb clone was built as a week-long project </p>
                  <p>  for a rigorous 1000+ hour software engineering bootcamp.</p>
              </div>
          </div>
      </>
    )
  }
  export default Footer;
